INSERT INTO `fundraisers` VALUES (1,'John Doe','Eco-Clean: providing clean drinking water.',5000.00,100.00,'New York',1,3,'<p>My campaign started in 2023 with an aim to provide clean drinking water & reduce wastage of water. At first, I focused my efforts on construction workers, who did not have access to clean drinking water. Through my own efforts, I raised funds and distributed 40 gravity water-filters to multiple sites in Delhi-NCR.</p>\r\n\r\n<p>Another segment that I want to help is school children, and I\'ve identified 14 schools in separate villages in Punjab and U.P impacting over 3000 kids. The drinking water in these villages has a high level of TDS, which makes it unfit for drinking. Many children are already suffering from ailments related to this water.</p>\r\n\r\n<p>At present, they are using very basic candle filters (sand filters) which are ineffective for high levels of TDS and other contaminants.</p>\r\n\r\n<p><strong>Solution:</strong> After visiting these places, and understanding the situation first-hand, I\'ve realised that the solution is to install R.O. filter systems, which will ensure that the water is fit for drinking. At the same time, I will also be installing large plastic drums to collect the waste water, which will be utilised for miscellaneous tasks such as gardening, cleaning, etc.</p>\r\n\r\n<p>Based on the number of students, the size of the R.O. system will be different. The company installing the system will also maintain the system for a period of 1 year and regularly monitor the water quality.</p>\r\n','data:image/jpeg;base64,'),(2,'Jane Smith','Solar Electrification of Remote Himalayan Village in Ladakh',10000.00,200.00,'Kargil',1,1,'<p>Engineer by education, Waste warrior by profession, explorer by heart and an aspiring environmentalist, I spent my childhood in the foothills of Himalayas at the banks of Ganga in Haridwar. My heart beats for the wellbeing of our mountains.</p>\r\n<p>I am Pranav. I work with a social enterprise called Saahas Zero Waste in the field of Waste management in Bangalore.</p>\r\n<p>I have previously worked in Infosys Technologies. My inclination towards environment and climate change led me to my current job.</p>\r\n<p>This July, Im joining a 20 person GHE team to bring solar energy to Sking, a small village in Zanskar valley of Ladakh. It comes under Kargil district. The village is located approximately 550 Kms from Leh at a height of 13500 ft. There is no school in the village and students normally are in the hostel in a school in a nearby town.</p>\r\n<p>The village is currently not connected to any form of road and also has no grid based electricity. We would trek for 2-3 days to reach the village from the last motorable point.</p>\r\n<p>Once there, we\'ll install a solar microgrid, power distribution and household lighting throughout the village. The end microgrid will be operated and maintained by people of skiing.</p>\r\n','data:image/jpeg;base64,'),(3,'Mike Johnson','Save Monkeys from Becoming an Endangered Species',500000.00,4800.00,'Ghaziabad',1,5,' <p>Dear Animal Lovers,</p>\n    <p>\n        Monkeys in India may soon become an endangered species as deforestation; large housing projects take over their natural habitats - the trees. Because they ask for their share of food and shelter from humans, they are branded as a menace. People loathe them and kill them, authorities are initiating drives for their mass-culling and sterilization, they are run down by rampant traffic, electrocuted by wires and poles, and at times, they just give in to lack of food or severe climate.\n    </p>\n\n    <p>\n        Is this fair?\n    </p>\n\n    <p>\n        <strong>\'Help a Monkey\'</strong> initiative was born as a result of putting an end to this torture. To save this dying race from meeting their sad deathly fates, we have started a feeding drive in the cities of Delhi, Vrindavan, Himachal Pradesh, Hyderabad, Tirupati, and Mysore from 2014.\n    </p>\n\n    <p>\n        Dhyan Foundation is treating many injured and electrocuted monkeys at its Gurgaon animal shelter.\n    </p>\n\n    <p>\n        Dhyan Foundation is feeding more than <strong>1500 monkeys</strong> daily in various cities:\n    </p>\n\n    <ul>\n        <li>Jhaku Temple, Himachal Pradesh  <strong>200</strong></li>\n        <li>Delhi Asola - <strong>300</strong></li>\n        <li>Delhi Faridabad Road - <strong>300</strong></li>\n        <li>Delhi Ridge Road  <strong>100</strong></li>\n        <li>Vrindavan Tattiyan Sthan  <strong>500</strong></li>\n        <li>Ghaziabad - <strong>25</strong></li>\n        <li>Telangana  <strong>110</strong></li>\n        <li>Andhra Pradesh Tirupati  <strong>25</strong></li>\n        <li>Karnataka, foot of chamunda hills Mysore - <strong>50</strong></li>\n    </ul>\n\n    <p>We need your help to:</p>\n    <ul>\n        <li>Buy a Maruti Eeco Van for more monkeys feeding in Delhi (On Road Price approx - <strong>4.5 lakhs</strong>)</li>\n        <li>Set up and maintain feeding spots for monkeys away from the roads</li>\n        <li>Increase forest cover. Plant/sponsor fruit-bearing trees for these and other forest dwellers</li>\n        <li>Sponsor their feed, to be placed in the heart of jungles by forest officers - so that they need not come out in the open</li>\n        <li>Conserve, recycle, reuse natural resources</li>\n    </ul>','data:image/jpeg;base64,'),(4,'Grosvenor','Help us tackle the emergency in youth mental health',7500.00,2000.00,'Chicago',1,1,'<p>We are facing a mental health emergency with over half of all young people struggling with their mental health. This October our Practice is supporting YoungMinds by taking part in Hello Yellow and raising vital funds to bring the conversation about young peoples mental health out in the open. Please donate today and help us build a world where young people dont feel alone with their mental health. Thank you so much.</p>','data:image/jpeg;base64,'),(5,'Rishi sharma','Help Feed The Stray Dogs Of Hyderabad',12000.00,5000.00,'Hyderabad',1,5,'<p>\n        <strong>EVERY PAW MATTERS</strong> is a social organisation that was started in April 2020 by school students across Hyderabad who are animal lovers. We are a small group of around <strong>30 volunteers</strong>, and we aim to feed and care for stray dogs and raise awareness about animal issues. We believe that each living being matters, and no one is superior.\n    </p>\n\n    <p>\n        As a group, we need at least <strong>INR 3,50,000</strong> for our feeding programme to last a year. Any funds raised beyond this will help feed and care for more animals around us on a daily basis.\n    </p>\n\n    <p>\n        We are running a crowdfunding campaign to help raise funds to provide food and water to stray animals, primarily dogs. Strays have very few means of getting good food and water on their own. Due to the pandemic, their sources of food have reduced significantly, but they werent good before either.\n    </p>\n\n    <p>\n        We are all animal lovers, and we started feeding many dogs at the beginning of the lockdown last year. Strays are very often looked down upon, but we believe them to be every person\'s strength. We feed around <strong>100 dogs</strong> every day and rely on funds and donations to sustain our efforts. We can only move forward with your support.\n    </p>\n\n    <p>\n        To continue our journey and to provide more meals, we ask for your help.\n    </p>','data:image/jpeg;base64,'),(6,'Jordon ','Support Families in Need of Essential Aid',5000.00,0.00,'Wilmington',1,4,' <p>\n        In the wake of <strong>Hurricane Helene</strong>, many families are struggling without basic necessities like clean water, food, and essential supplies. Entire communities have been devastated, leaving people vulnerable and in desperate need of help.\n    </p>\n\n    <p>\n        I am organizing a relief effort to personally deliver clean drinking water, non-perishable food, hygiene supplies, and other resources to those affected by the hurricane. With your support, we can make a real difference and bring hope to people during this incredibly difficult time.\n    </p>\n\n    <p>\n        The funds raised will go directly toward purchasing:\n    </p>\n    \n    <ul>\n        <li>Bottled water and water purification supplies</li>\n        <li>Non-perishable food</li>\n        <li>Hygiene products (soap, toothpaste, sanitary products)</li>\n        <li>Baby supplies (formula, diapers)</li>\n        <li>First aid and medical supplies</li>\n    </ul>\n\n    <p>\n        In addition, any excess funds will be donated to local shelters and organizations continuing the long-term recovery efforts.\n    </p>\n\n    <p>\n        Your contribution, no matter how small, will help provide comfort and essential aid to those in need. Lets come together to support these communities in their time of need. <strong>Every donation counts!</strong>\n    </p>\n\n    <p>\n        Thank you for your kindness and generosity.\n    </p>','data:image/webp;base64,'),(7,'Samaritans Purse','NAVEX Outreach - Caring for our North Carolina Community',15000.00,0.00,'Lake Oswego',1,4,' <p>\n        In light of the ongoing unprecedented events in the <strong>North Carolina</strong> region, <strong>NAVEX</strong> is standing in solidarity with our local community in North Carolina. Our CEO, <strong>Sean Thompson</strong>, has announced that NAVEX will be contributing a minimum of <strong>$10,000</strong> to relief efforts through our NAVEX Outreach Program.\n    </p>\n\n    <p>\n        Together as a team, we have the opportunity to collectively contribute a minimum of <strong>$10,000</strong>, and together, we are stronger. To facilitate our efforts, NAVEX has partnered with <strong>Samaritan\'s Purse</strong>, an organization that provides assistance to those facing challenging circumstances such as poverty or natural disasters. This organization will oversee the distribution of our donated funds, which will be utilized to provide essential necessities such as food and water.\n    </p>\n\n    <p>\n        We deeply appreciate the care and commitment that you are showing towards each other, our communities, and our customers.\n    </p>\n\n    <p>\n        We welcome you to <a href=\"https://www.gofundme.com/\" target=\"_blank\">donate</a> or share our GoFundMe page.\n    </p>\n\n    <p>\n        If you have any questions, please do not hesitate to reach out to <a href=\"mailto:HR@navex.com\">HR@navex.com</a>.\n    </p>','data:image/webp;base64,'),(8,'Karin Noelle','Horan Hurricane Milton Help',8000.00,0.00,'Petersburg',1,3,' <p>\n        <strong>Ryan</strong>, <strong>Adriana</strong>, and I lost our home during <strong>Hurricane Milton</strong> after a tree fell on the roof, causing major damage. Our home is completely demolished and uninhabitable.\n    </p>\n\n    <p>\n        Any amount can help with the many expenses involved, including: <strong>insurance deposit</strong>, <strong>food</strong>, <strong>relocation</strong>, <strong>diapers</strong>, etc. \n    </p>\n\n    <p>\n        We also have two dogs; <strong>Jeffrey</strong> and <strong>Jenny</strong>, which makes temporary living accommodations extremely difficult to find. \n    </p>\n\n    <p>\n        Our family thanks you in advance for any assistance that you may be able to provide!\n    </p>','data:image/webp;base64,'),(9,'Harley Bettis','Hurricane Milton left five feet of water in my house!!',2500.00,0.00,'Valrico',1,3,' <p>\n        Hey yall its <strong>Harley</strong>. I dont even know what to say. Im at a complete loss for words at this point. <strong>Worst year of my life</strong>. I got laid off after <strong>15 years</strong>. I cant find a job to save my life. \n    </p>\n\n    <p>\n        Were hit by <strong>Tropical Storm Debbie</strong>, then we are hit by <strong>Hurricane Helene</strong>, and last night I rode out <strong>Hurricane Milton</strong>, which was one of the most frightening things Ive ever experienced in my life. Everything passes with the sun coming up and POW!! Here comes the water. It took two hours to go from nothing to a foot of water inside my house. A <strong>complete loss</strong>.\n    </p>\n\n    <p>\n        Unfortunately, theres no insurance company in the world who will insure my property due to the floods. I hate <strong>Mother Nature</strong> and Im starting to hate <strong>Florida</strong>. I dont ask people for anything. I dont want to be that guy who cant make it on his own, but I dont really know what to do or where to go from here.\n    </p>\n\n    <p>\n        If youve got a <strong>nickel</strong> to spare, Ill use it wisely. If you dont, Im sure youve reached out in your own way to offer some help or reassure me that everything will be okay. I thank each and every one of you for the help. The money will be used for <strong>pure survival</strong> and getting to where I have a place to lay my head.\n    </p>','data:image/webp;base64,'),(10,'Jackie ','Barclay Elementary School Race for Education',10000.00,0.00,'Warrington Township',1,2,' <p>\n        <strong>John Barclay Elementary School</strong>\n    </p>\n\n    <p>\n        On <strong>Friday, October 25, 2024</strong>, Barclay Elementary Home & School Association will be conducting a <strong>Race for Education Fundraiser.</strong> The purpose will be to raise funds for <strong>outdoor classrooms</strong>, <strong>field trips</strong> and their transportation costs, <strong>assemblies</strong>, and alleviate overall HSA fundraising needed for the next two years. Students will walk or jog around a <strong>1/4-mile</strong> area as many times as possible in a one-hour period.\n    </p>\n\n    <p>\n        Please include your student\'s name after donation.\n    </p>\n\n    <p>\n        <strong>El viernes 25 de octubre de 2024</strong>, la Asociacin de Hogares y Escuelas de la Escuela Primaria Barclay llevar a cabo una <strong>\"Carrera para recaudar fondos para la educacin.\"</strong> El objetivo ser recaudar fondos para <strong>aulas al aire libre</strong>, <strong>excursiones</strong> y sus costos de transporte, <strong>asambleas</strong> y aliviar la recaudacin de fondos general de la HSA necesaria para los prximos dos aos. Los estudiantes caminarn o trotarn alrededor de un rea de <strong>1/4 de milla</strong> tantas veces como sea posible en un perodo de una hora.\n    </p>\n\n    <p>\n        Incluya el nombre de su estudiante despus de la donacin.\n    </p>\n\n    <p>\n        Gracias por donar a mi escuela.\n    </p>','data:image/webp;base64,');
